DROP SCHEMA IF EXISTS data_mart CASCADE; 
CREATE SCHEMA data_mart; 

CREATE TABLE data_mart.weekly_sales(
   week_date     DATE  NOT NULL PRIMARY KEY
  ,region        VARCHAR(13) NOT NULL
  ,platform      VARCHAR(7) NOT NULL
  ,segment       VARCHAR(4)
  ,customer_type VARCHAR(8) NOT NULL
  ,transactions  INTEGER  NOT NULL
  ,sales         INTEGER  NOT NULL
);
